     {/* <input type="number" placeholder="شماره همراه" /> */}
     <input type="email" placeholder="ایمیل" />
    <input type="password" placeholder="پسورد" />
    <input type="submit" placeholder="ثبت نام" />
        </div>
    )
}
export default Register;
